import React from 'react';
import { Link } from 'react-router-dom';
import { Button, Typography } from '@material-ui/core';

const HomePage = () => {
  return (
    <div>
      <Typography variant="h3" gutterBottom>Welcome to Hasaki Store</Typography>
      <Button component={Link} to="/products" variant="contained" color="primary">View Products</Button>
    </div>
  );
}

export default HomePage;
